import React from "react";
import ReactDom from "react-dom";

var today = new Date();
var date =
  today.getFullYear() + "-" + (today.getMonth() + 1) + "-" + today.getDate();

ReactDom.render(
  <React.Fragment>
    <h1>hello, Aman Kumar Singh</h1>
    <p>Current date: {`${date}`}</p>
  </React.Fragment>,
  document.getElementById("root")
);
